import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Row from 'react-bootstrap/Row';
import Container from "react-bootstrap/Container";
import './SignUp.scss';
import {useNavigate} from "react-router-dom";
import {FloatingLabel} from "react-bootstrap";

function FormExample() {
    const [validated, setValidated] = useState(false);
    const navigate = useNavigate();
    // Stati per i campi del form
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [state, setState] = useState('');
    const [agree, setAgree] = useState(false);

    const handleSubmit = (event: any) => {
        const form = event.currentTarget;
        if (form.checkValidity() === false) {
            event.preventDefault();
            event.stopPropagation();
        } else {
            // Qui puoi fare qualcosa con i valori dei campi del form
            console.log('First Name:', firstName);
            console.log('Last Name:', lastName);
            console.log('Email:', email);
            console.log('password', password);
            console.log('State:', state);
            console.log('Agree to terms and conditions:', agree);
            navigate('/home')
        }

        setValidated(true);
    };

    return (
        <Container as={Col} className={"py-2 SignUpContainer d-flex justify-content-center align-items-center"}>
            <Form noValidate validated={validated} onSubmit={handleSubmit}>
                <Row className="mb-3 ">
                    <Form.Group controlId="nameValidation">
                        <FloatingLabel label={"First Name"}>
                        <Form.Control
                            required
                            type="text"
                            placeholder="First name"
                            value={firstName}
                            onChange={(e) => setFirstName(e.target.value)}
                        /></FloatingLabel>
                        <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                    </Form.Group>
                    <Form.Group controlId="surnameValidation">
                        <FloatingLabel label={"Last Name"}>
                        <Form.Control
                            required
                            type="text"
                            placeholder="Last name"
                            value={lastName}
                            onChange={(e) => setLastName(e.target.value)}
                        />
                        </FloatingLabel>
                        <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                    </Form.Group>
                    <Form.Group controlId="validationEmail">
                        <Form.Label>Email</Form.Label>
                        <InputGroup hasValidation>
                            <Form.Control
                                type="email"
                                placeholder="email"
                                aria-describedby="inputGroupPrepend"
                                required
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                            />
                            <Form.Control.Feedback type="invalid">
                                Please insert your email.
                            </Form.Control.Feedback>
                        </InputGroup>
                    </Form.Group>
                    <Form.Group controlId="validationState">
                        <Form.Label>State</Form.Label>
                        <Form.Control
                            type="text"
                            placeholder="State"
                            required
                            value={state}
                            onChange={(e) => setState(e.target.value)}
                        />
                        <Form.Control.Feedback type="invalid">
                            Please provide a valid state.
                        </Form.Control.Feedback>
                    </Form.Group>
                </Row>
                <Form.Group className="mb-3">
                    <Form.Check
                        required
                        label="Agree to terms and conditions"
                        feedback="You must agree before submitting."
                        feedbackType="invalid"
                        checked={agree}
                        onChange={(e) => setAgree(e.target.checked)}
                    />
                </Form.Group>
                <Button type="submit">Submit form</Button>
            </Form>
        </Container>
    );
}

export default FormExample;
